import { Link } from "react-router-dom";

const PatientLogin = ()=>{
    

    return(
        <div>
            <p>
               <Link to="/doctorlogin">Are You DOCTOR</Link>
            </p>
            <h4 className="opacity-75">Patient Login</h4>
            <form className="col-sm-10">
                <p className="opacity-50">Patient Email ID</p>
                <input className="form-control" type="Email" placeholder="Enter Email ID" /><br/>
                <p className="opacity-50">Patient Password</p>
                <input className="form-control" type="password" placeholder="Enter Password" /><br/>
                <div>
                    <button type="Submit" className="btn btn-primary">SUBMIT</button>
                </div>                               
            </form> 
            <br/>
            <Link to="/PatientRegistration">New Patient ? Reg. Here</Link>         
        </div>
    );
}

export default PatientLogin;
